        function save() {
            localStorage.setItem('regs', JSON.stringify(state.registrations));
            localStorage.setItem('inv', JSON.stringify(state.inventory));
            if (firebaseReady) {
                database.ref('regs').set(state.registrations);
                database.ref('inv').set(state.inventory);
            }
        }

        function load() {
            const r = localStorage.getItem('regs');
            const i = localStorage.getItem('inv');
            if (r) state.registrations = JSON.parse(r);
            if (i) state.inventory = JSON.parse(i);
            
            if (firebaseReady) {
                database.ref('regs').on('value', s => {
                    if (s.val()) {
                        state.registrations = s.val();
                        if (state.view !== 'register') draw();
                    }
                });
                database.ref('inv').on('value', s => {
                    if (s.val()) {
                        state.inventory = s.val();
                        if (state.view !== 'register') draw();
                    }
                });
            }
        }

        function getKit() {
            const kits = ['arduino', 'robot', 'stem'].filter(k => 
                state.inventory[k].assigned < state.inventory[k].total
            );
            return kits.length ? kits[Math.floor(Math.random() * kits.length)] : null;
        }

        function register() {
            state.error = '';
            state.success = '';

            if (!state.teamNumber || state.teamNumber.length < 4) {
                state.error = 'Please enter a valid team number';
                draw();
                return;
            }

            if (!teams[state.teamNumber]) {
                state.error = 'Team number not found';
                draw();
                return;
            }

            if (state.registrations.find(r => r.teamNumber === state.teamNumber)) {
                state.error = 'Team already registered! Each team gets only one kit.';
                draw();
                return;
            }

            const kit = getKit();
            if (!kit) {
                state.error = 'All kits claimed!';
                draw();
                return;
            }

            state.registrations.push({
                teamNumber: state.teamNumber,
                teamName: teams[state.teamNumber],
                kitType: kit,
                kitName: state.inventory[kit].name,
                time: new Date().toISOString(),
                status: 'pending',
                given: false
            });

            state.inventory[kit].assigned++;
            state.success = 'Success! Team ' + state.teamNumber + ' assigned: ' + state.inventory[kit].name;
            state.teamNumber = '';
            state.teamName = '';
            
            save();
            draw();
        }

        function reset() {
            const code = prompt('WARNING: This will delete ALL registrations!\n\nTo confirm, please type: RESET2025');
            if (code === 'RESET2025') {
                state.registrations = [];
                state.inventory = {
                    arduino: { total: 20, assigned: 0, name: 'Arduino Kit (70511)' },
                    robot: { total: 20, assigned: 0, name: 'Robot Kit (70695)' },
                    stem: { total: 20, assigned: 0, name: 'STEM Projects (71676)' }
                };
                state.view = 'home';
                save();
                alert('All data has been reset successfully.');
                draw();
            } else if (code !== null) {
                alert('Reset cancelled. Incorrect confirmation code.');
            }
        }

        function go(v) {
            state.view = v;
            state.error = '';
            state.success = '';
            state.teamNumber = '';
            state.teamName = '';
            draw();
        }

        function toggleGiven(i) {
            state.registrations[i].given = !state.registrations[i].given;
            state.registrations[i].status = state.registrations[i].given ? 'ready' : 'pending';
            save();
            draw();
        }

        function markDone(i) {
            state.registrations[i].status = 'done';
            save();
            draw();
        }

        function checkStatus() {
            const statusDiv = document.getElementById('statusCheck');
            if (!statusDiv || !state.registrations.length) return;
            const lastReg = state.registrations[state.registrations.length - 1];
            if (lastReg.status === 'done') {
                statusDiv.innerHTML = '<p class="text-sm font-semibold text-gray-600"> Complete</p><p class="text-xs text-gray-500 mt-1">Kit picked up. Each team gets only one kit.</p>';
                statusDiv.className = 'mt-3 p-3 bg-gray-50 border rounded';
            } else if (lastReg.status === 'ready') {
                statusDiv.innerHTML = '<p class="text-sm font-semibold text-green-700"> Ready!</p><p class="text-xs text-green-600 mt-1">Come to DIY Workshop table to collect your kit.</p>';
                statusDiv.className = 'mt-3 p-3 bg-green-50 border border-green-200 rounded';
            } else {
                statusDiv.innerHTML = '<p class="text-sm font-semibold text-yellow-800"> Pending</p><p class="text-xs text-yellow-700 mt-1">Your kit is being prepared. Please wait.</p>';
                statusDiv.className = 'mt-3 p-3 bg-yellow-50 border border-yellow-200 rounded';

                            <div class="mb-4">
                                <label class="block text-sm font-medium mb-1">FLL Team Number <span class="text-red-500">*</span></label>
                                <input type="text" id="num" value="${state.teamNumber}" placeholder="e.g., 70511" class="w-full px-4 py-2 border rounded-lg">
                                <div id="name"></div>
                            </div>
                            <button onclick="register()" class="w-full bg-purple-600 text-white py-3 rounded-lg font-semibold hover:bg-purple-700">
                                Register & Get Kit
                            </button>
                        </div>
                        <div class="mt-6 text-center">
                            <p class="text-sm text-white opacity-90">App created by Ivan & Inaaya, friends of FLL Teams 70511, 70695, 71076</p>
                        </div>
                    </div>
                `;
                
                const input = document.getElementById('num');
                input.addEventListener('input', (e) => {
                    if (e.target.value.toLowerCase() === 'wd3r32') {
                        go('admin');
                        return;
                    }
                    state.teamNumber = e.target.value.replace(/[^a-zA-Z0-9]/g, '');
                    e.target.value = state.teamNumber;
                    const name = document.getElementById('name');
                    if (teams[state.teamNumber]) {
                        name.innerHTML = '<div class="mt-2 p-3 bg-blue-50 border rounded"><p class="text-sm text-blue-900"><strong>Is this your team?</strong><br>' + teams[state.teamNumber] + '</p></div>';
                    } else {
                        name.innerHTML = '';
                    }
                });
                input.focus();
                
                if (state.success) {
                    setTimeout(checkStatus, 100);
                    setInterval(checkStatus, 2000);
                }
            } else if (state.view === 'admin') {
                const inv = state.inventory;
                app.innerHTML = `
                    <div class="min-h-screen bg-gray-100 p-6">
                        <div class="max-w-6xl mx-auto">
                            <div class="bg-white rounded-lg shadow-lg p-6 mb-6">
                                <div class="flex justify-between items-center mb-6">
                                    <h2 class="text-2xl font-bold">Workshop Admin</h2>
                                    <button onclick="go('home')" class="bg-gray-200 px-4 py-2 rounded hover:bg-gray-300">Back</button>
                                </div>
                                <div class="grid grid-cols-4 gap-4 mb-6">
                                    <div class="bg-green-500 text-white p-4 rounded">
                                        <p class="text-sm">Arduino</p>
                                        <p class="text-3xl font-bold">${inv.arduino.total - inv.arduino.assigned}/${inv.arduino.total}</p>
                                    </div>
                                    <div class="bg-blue-500 text-white p-4 rounded">
                                        <p class="text-sm">Robot</p>
                                        <p class="text-3xl font-bold">${inv.robot.total - inv.robot.assigned}/${inv.robot.total}</p>
                                    </div>
                                    <div class="bg-purple-500 text-white p-4 rounded">
                                        <p class="text-sm">STEM</p>
                                        <p class="text-3xl font-bold">${inv.stem.total - inv.stem.assigned}/${inv.stem.total}</p>
                                    </div>
                                    <div class="bg-gray-800 text-white p-4 rounded">
                                        <p class="text-sm">Total</p>
                                        <p class="text-3xl font-bold">${state.registrations.length}</p>
                                    </div>
                                </div>
                                <div class="flex justify-end mb-4">
                                    <button onclick="reset()" class="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600">Reset All Data</button>
                                </div>
                            </div>
                            <div class="bg-white rounded-lg shadow-lg p-6">
                                <h3 class="text-xl font-bold mb-4">Registered Teams</h3>
                                ${state.registrations.length === 0 ? '<p class="text-gray-500 text-center py-8">No teams yet</p>' : `
                                    <table class="w-full">
                                        <thead>
                                            <tr class="bg-gray-50 border-b">
                                                <th class="px-4 py-3 text-left text-xs font-semibold">Team #</th>
                                                <th class="px-4 py-3 text-left text-xs font-semibold">Name</th>
                                                <th class="px-4 py-3 text-left text-xs font-semibold">Kit</th>
                                                <th class="px-4 py-3 text-left text-xs font-semibold">Status</th>
                                                <th class="px-4 py-3 text-left text-xs font-semibold">Actions</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            ${state.registrations.map((r, i) => {
                                                const kc = r.kitType === 'arduino' ? 'bg-green-100 text-green-800' : r.kitType === 'robot' ? 'bg-blue-100 text-blue-800' : 'bg-purple-100 text-purple-800';
                                                const statusBadge = r.status === 'done' ? '<span class="px-2 py-1 rounded text-xs bg-gray-100"> Done</span>' : r.status === 'ready' ? '<span class="px-2 py-1 rounded text-xs bg-green-100 text-green-700"> Ready</span>' : '<span class="px-2 py-1 rounded text-xs bg-yellow-100 text-yellow-700"> Pending</span>';
                                                return `
                                                    <tr class="border-b hover:bg-gray-50">
                                                        <td class="px-4 py-3 text-sm font-medium">${r.teamNumber}</td>
                                                        <td class="px-4 py-3 text-sm">${r.teamName}</td>
                                                        <td class="px-4 py-3 text-sm"><span class="px-2 py-1 rounded text-xs ${kc}">${r.kitName}</span></td>
                                                        <td class="px-4 py-3 text-sm">${statusBadge}</td>
                                                        <td class="px-4 py-3 text-sm">
                                                            ${r.status !== 'done' ? `
                                                                <div class="flex gap-2">
                                                                    <label class="flex items-center gap-1">
                                                                        <input type="checkbox" ${r.given ? 'checked' : ''} onchange="toggleGiven(${i})" class="w-4 h-4">
                                                                        <span class="text-xs">Given</span>
                                                                    </label>
                                                                    <button onclick="markDone(${i})" class="px-2 py-1 bg-gray-200 rounded text-xs hover:bg-gray-300">Done</button>
                                                                </div>
                                                            ` : '<span class="text-xs text-gray-500">Complete</span>'}
                                                        </td>
                                                    </tr>
                                                `;
                                            }).join('')}
                                        </tbody>
                                    </table>
                                `}
                            </div>
                            <div class="mt-6 text-center">
                                <p class="text-sm text-gray-600">App created by Ivan & Inaaya, friends of FLL Teams 70511, 70695, 71076</p>
                            </div>
                        </div>
                    </div>
                `;
            }
        }

        load();
        draw();
    </script>

</body></html>
